function JS_Logger(e,t){this.logLevel=e;var n=this.useUrl("log");if(n!=false){this.logLevel=n}if(t===undefined){this.logArray;this.logLevel=false}else{this.logArray=t}}JS_Logger.prototype.useUrl=function(e){e=e.replace(/[\[]/,"\\[").replace(/[\]]/,"\\]");var t="[\\?&]"+e+"=([^&#]*)";var n=new RegExp(t);var r=n.exec(window.location.href);if(r==null)return false;else return r[1]};JS_Logger.prototype.out=function(e,t){if(this.logLevel!=false){console.log(this.compileMsg(e,t))}};JS_Logger.prototype.error=function(e,t){if(this.logLevel!=false){console.error(this.compileMsg(e,t))}};JS_Logger.prototype.warn=function(e,t){if(this.logLevel!=false){console.warn(this.compileMsg(e,t))}};JS_Logger.prototype.info=function(e,t){if(this.logLevel!=false){console.info(this.compileMsg(e,t))}};JS_Logger.prototype.group=function(e){if(this.logLevel!=false){console.group(this.compileMsg(e))}};JS_Logger.prototype.groupEnd=function(){if(this.logLevel!=false){console.groupEnd()}};JS_Logger.prototype.compileMsg=function(e,t){if(t===undefined){t=""}if(this.logArray[e]===undefined){return t}else{return this.logArray[e]+" "+t}}